  "description": "Gustaf Julius Emanuel Håkanson was a Swedish lawyer. He was born on November 25, 1879 in Östersund to Julius H. and Märta Brita Thorén. He completed the bar exam in Visby in 1900, preliminary law exam in Uppsala in 1901, appellate court exam in 1905. He became a deputy notary in the Svea Court of Appeal in 1905, served as a court clerk in Piteå from 1907-1909, acting mayor there in 1907, worked as a clerk in the Svea Court of Appeal during the autumn session from 1909-1911, occasionally serving as an assistant prosecutor with temporary assignments in the water board from 1911. He was employed at H. Wikström's law firm in Gothenburg from 1912-1915, then started his own law practice there. He became a member of the Swedish Bar Association in 1929. He authored 'Should party interests dominate over the nation's interest in determining suffrage?' (1907) and 'Sweden's people facing a new reformation' (1935)."
